import {Link, NavLink} from 'react-router-dom';
import useHistory from "react-router-dom";


import React from 'react'

const Topbar = () => {

  // const history = useHistory();
  // async function handleLogout() {
  //   await Auth.signOut();

  //   userHasAuthenticated(false);

  //   history.push("/login");
  // }
  return (
    <Navbar bg="light" expand="lg">
  <Container fluid>
    <Navbar.Brand href="/" style={{ fontWeight:'bold',fontSize:25 ,  padding: 10 }}>LOGO</Navbar.Brand>

      <Nav
        className="me-auto my-2 my-lg-0"
        style={{ maxHeight: '100px' }}>

        <Link to="/User" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>Users</Link> <br/>

        <Link to="/Products" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>Products</Link><br/>

        <Link to="/AddProducts" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>New</Link><br/>

        <Link to="/Reviews" style={{ fontWeight:'bold',fontSize:20 ,  padding: 10 }}>Review</Link><br/>

        <Nav>
            <Form className="d-flex">
        <FormControl
          type="search"
          placeholder="Search"
          aria-label="Search"
        />

      </Form>
      </Nav>
      </Nav>
      {/* <Nav><Button onClick={handleLogout}  style={{ fontWeight:'bold',fontSize:20 ,  padding: 20 }}>Logout</Button></Nav> */}


  </Container>
</Navbar>
  )
}

export default Topbar
